import React from "react";

const LoginScreen = () => {
    return (
        <form>
            <div>
                <p>UserName</p>
                <input></input>
            </div>
            <div>
                <p>Password</p>
                <input></input>
            </div>
            <div>
                <button>Login</button>
            </div>
            
        </form>
    )
}

export default LoginScreen;
